var SAEL_Behance = function ($scope, $) {
    var saelBehanceElem = $scope.find(".sa-el-behance-container"),
            loadingFeed = $scope.find(".sa-el-loading-feed"),
            saelBehanceSettings = saelBehanceElem.data("settings");

    function get_behance_data() {
        saelBehanceElem.embedBehance({
            apiKey: saelBehanceSettings["api_key"],
            userName: saelBehanceSettings["username"],
            project: saelBehanceSettings["project"],
            owners: saelBehanceSettings["owner"],
            appreciations: saelBehanceSettings["apprectiations"],
            views: saelBehanceSettings["views"],
            publishedDate: saelBehanceSettings["date"],
            fields: saelBehanceSettings["fields"],
            projectUrl: saelBehanceSettings["url"],
            infiniteScrolling: false,
            description: saelBehanceSettings["desc"],
            animationEasing: "easeInOutExpo",
            ownerLink: true,
            tags: true,
            containerId: saelBehanceSettings["id"],
            itemsPerPage: saelBehanceSettings["number"]
        });
    }

    $.ajax({
        url: get_behance_data(),


    });

};

jQuery(window).on("elementor/frontend/init", function () {
    elementorFrontend.hooks.addAction(
            "frontend/element_ready/sa_el_behance_feed.default",
            SAEL_Behance
            );
});